        color: '#000000',
        overflow: 'hidden',
        width: '400px',
        fontFamily: 'Overpass,sans-serif',
        fontWeight: 'bold',
        textAlign: 'left',
        alignItems: 'left',
        borderRadius: '20px',
        padding: '15px 0px 15px 25px'
    }

    return (
        <div key="index">

            {localPhoneDetails ? localPhoneDetails.map((localPhoneDetail) => (
                <div className="card" key="index2" style={rootStyle}>
                    <div className="card-body">
