                        <p className="card-text">Carrier: {localPhoneDetail.result[0]["Line Provider"]}</p> */}
                        <p className="card-text">Message: {localPhoneDetail.message}</p>
                    </div>
                </div>
            )) : console.log('no map')}
        </div>
    )
}



export default ReturnDetails
